import React from 'react'
import './header.css';

function Header() {
  return (
    <div className='hpt3__header section__padding' id="home">
      <div className='gpt3__header-content'>
        <h1 className='gradient__text'></h1>
      </div>
    </div>
  )
}

export default Header
